.then(res =>{setBullDog(res.data.message.bulldog)})
.catch((err)=>console.log(err))
},[])

console.log(mouses)
console.log(teclados)

  return (

    <div className="App">
      <NavBar/>
      <main>
        <ItemListContainer/>
        {bulldog.map((b)=>(<h3>{b}</h3>))}
      </main>
      <Footer/>
    </div>

  )
}

export default App;
